/* eslint-disable */

import React from 'react';
import Applicants from 'pages/dashboard/applicants/Applicants';
import contants from 'rayaConstants';
import PropTypes from 'prop-types';
import SampleBulmaTable from 'samples/SampleBulmaTable';

// eslint-disable-next-line react/prop-types
const DashboardBodySection = ({ section }) => {
  switch (section) {
    case contants.dashboard.sections.APPLICANTS:
      return <Applicants />;
    default:
      return <SampleBulmaTable />;
      // return (<div>Oops, please select a navigation on the left.</div>);
  }
};

const DashboardBody = ({ section }) => (
  <div>
    {
      // Switch Statement
      {
        [contants.dashboard.sections.APPLICANTS]: <Applicants />,
      }[section] || <SampleBulmaTable />
    }
  </div>
);

DashboardBody.defaultProps = {
  section: '',
};
DashboardBody.propTypes = {
  section: PropTypes.string,
};

export default DashboardBody;
